import React from "react";
import {notes} from "../notes"

function Firstnote(prop){
return <div>
    <h1>{prop.title}</h1>
    <p>{prop.content}</p>
    </div>;
}

function Createnote(note){
return <Firstnote
        key={notes.key}
        title={notes.title}
        content={notes.content}
/>  ;
}

function Note(){
    return <div className="note">
        {<Firstnote title={notes[1].title} content={notes[1].content}/>}
    </div>;
}

export default Note;
